069\u006e\u003a\u0035\u0030\u0070\u0078\u0020\u0061\u0075\u0074\u006f\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0031\u002e\u0039\u0025\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0027\u0054\u0065\u006b\u006f\u0027\u003b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0030\u0030\u0030\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0072\u0061\u0064\u0069\u0075\u0073\u003a\u0031\u0030\u0070\u0078\u003b\u000a\u007d\u000a\u002e\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u006c\u006f\u0067\u0069\u006e\u002d\u0074\u0077\u0069\u0074\u0074\u0065\u0072\u0020\u007b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0023\u0066\u0066\u0066\u003b\u000a\u0009\u006d\u0061\u0078\u002d\u0077\u0069\u0064\u0074\u0068\u003a\u0033\u0033\u0030\u0070\u0078\u003b\u000a\u0009\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0061\u0075\u0074\u006f\u003b\u000a\u0009\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0072\u0065\u006c\u0061\u0074\u0069\u0076\u0065\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u003a\u0035\u0030\u0070\u0078\u0020\u0061\u0075\u0074\u006f\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0031\u0030\u0025\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0027\u0054\u0065\u006b\u006f\u0027\u003b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0030\u0030\u0030\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0072\u0061\u0064\u0069\u0075\u0073\u003a\u0031\u0030\u0070\u0078\u003b\u000a\u007d\u000a\u002e\u0063\u006c\u006f\u0073\u0065\u002d\u0066\u0062\u0020\u007b\u000a\u0009\u0062\u006