9\u006e\u002d\u0074\u006f\u0070\u003a\u0020\u002d\u0031\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0072\u0069\u0067\u0068\u0074\u003a\u0020\u0035\u0070\u0078\u003b\u000a\u0009\u0066\u006c\u006f\u0061\u0074\u003a\u0020\u006c\u0065\u0066\u0074\u003b\u000a\u007d\u000a\u002e\u0062\u0061\u006c\u0061\u006e\u0063\u0065\u002d\u006e\u006f\u006d\u0020\u007b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0066\u0066\u0066\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0031\u0036\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0074\u006f\u0070\u003a\u0020\u0031\u0030\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u0034\u0070\u0078\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0027\u006e\u0076\u006e\u0027\u002c\u0020\u0063\u0075\u0072\u0073\u0069\u0076\u0065\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0077\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0035\u0030\u0030\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0020\u006c\u0065\u0066\u0074\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0030\u0020\u0031\u0070\u0078\u0020\u0030\u0020\u0023\u0030\u0030\u0030\u003b\u000a\u007d\u000a\u002e\u0062\u0061\u006c\u0061\u006e\u0063\u0065\u002d\u0064\u0065\u0074\u0061\u0069\u006c\u0020\u007b\u000a\u0020\u0020\u0020\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0075\u0072\u006c\u0028\u0069\u006d\u0067\u002f\u0062\u0067\u002d\u0064\u0065\u0074\u002e\u0070\u006e\u0067\u0029\u0020\u006e\u006f\u002d\u0072\u0065\u0070\u0065\u0061\u0074\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0073\u0069\u007a\u0065\u003a\u0031\u0030\u0030\u0025\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0061\u0075\u0074\u006f\u003b\u000a\u0009\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0061\u0075\u0074\u006f\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0074\u006f\u0070\u003a\u0020\u0032\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u006c\u0065\u0066\u0074\u003a\u0020\u0035\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0072\u0069\u0067\u0068\u0074\u003a\u0020\u0038\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u0033\u0070\u0078\u003b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0066\u0066\u0066\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0031\u0034\u0070\u0078\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0027\u006e\u0076\u006e\u0027\u002c\u0020\u0063\u0075\u0072\u0073\u0069\u0076\u0065\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0030\u0020\u0031\u0070\u0078\u0020\u0030\u0020\u0023\u0030\u0030\u0030\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u006c\u0065\u0066\u0074\u003a\u0020\u0033\u0070\u0078\u0020\u0073\u006f\u006c\u0069\u0064\u0020\u0023\u0046\u0041\u0042\u0032\u0030\u0033\u003b\u000a\u0009\u006c\u0069\u006e\u0065\u002d\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0035\u0070\u0078\u003b\u000a\u0009\u0066\u006c\u006f\u0061\u0074\u003a\u0020\u006c\u0065\u0066\u0074\u003b\u000a\u007d\u000a\u002e\u0062\u0061\u006c\u0061\u006e\u0063\u0065\u0020\u0062\u0075\u0074\u0074\u006f\u006e\u0020\u007b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0075\u0072\u006c\u0028\u0069\u006d\u0067\u002f\u0073\u0065\u0033\u006c\u006f\u0077\u0063\u006f\u006c\u006f\u006b\u002e\u0070\u006e\u0067\u0029\u0020\u006e\u006f\u002d\u0072\u0065\u0070\u0065\u0061\u0074\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u002d\u0073\u0069\u007a\u0065\u003a\u0031\u0030\u0030\u0025\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0033\u0035\u0025\u003b\u000a\u0009\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0033\u0030\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0020\u002d\u0031\u0030\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0072\u0069\u0067\u0068\u0074\u003a\u0020\u0034\u0070\u0078\u003b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u003a\u0020\u0035\u0070\u0078\u003b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0030\u0030\u0030\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0031\u0037\u0070\u0078\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0027\u006e\u0076\u006e\u0027\u002c\u0020\u0063\u0075\u0072\u0073\u0069\u0076\u0065\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u003a\u0030\u0020\u0031\u0070\u0078\u0020\u0030\u0020\u0023\u0066\u0066\u0066\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u000a\u0009\u006f\u0075\u0074\u006c\u0069\u006e\u0065\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u000a\u0009\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0072\u0065\u006c\u0061\u0074\u0069\u0076\u0065\u003b\u000a\u0009\u0066\u006c\u006f\u0061\u0074\u003a\u0020\u0072\u0069\u0067\u0068\u0074\u003b\u000a\u007d\u000a\u002e\u0062\u006f\u0078\u0020\u007b\u000a\u0020\u0020\u0020\u0020\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0039\u0035\u0025\u003b\u000a\u0020\u0020\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0061\u0075\u0074\u006f\u003b\u000a\u0020\u0020\u0020\u0020\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u006c\u0065\u0066\u0074\u003a\u0061\u0075\u0074\u006f\u003b\u000a\u0020\u0020\u0020\u0020\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0072\u0069\u0067\u0068\u0074\u003a\u0061\u0075\u0074\u006f\u003b\u000a\u0020\u0020\u0020\u0020\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0020\u0032\u0030\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u0032\u0035\u0070\u0078\u003b\u000a\u0009\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0072\u0065\u006c\u0061\u0074\u0069\u0076\u0065\u003b\u000a\u0009\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u0062\u006c\u006f\u0063\u006b\u003b\u000a\u007d\u0020\u000a\u002e\u0073\u0063\u0072\u006f\u006c\u006c\u0020\u007b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0031\u0030\u0030\u0025\u003b\u0009\u000a\u0009\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0072\u0065\u006c\u0061\u0074\u0069\u0076\u0065\u003b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0009\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0034\u0030\u0030\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0035\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0032\u0030\u0070\u0078\u003b\u000a\u0009\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u0062\u006c\u006f\u0063\u006b\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0066\u0061\u0063\u0065\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0073\u0068\u0061\u0064\u006f\u0077\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0068\u0069\u0067\u0068\u006c\u0069\u0067\u0068\u0074\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0033\u0064\u006c\u0069\u0067\u0068\u0074\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0064\u0061\u0072\u006b\u0073\u0068\u0061\u0064\u006f\u0077\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0074\u0072\u0061\u0063\u006b\u002d\u0063\u006f\u006c\u006f\u0072\u003a\u0023\u0066\u0066\u0062\u0062\u0034\u0030\u003b\u000a\u0009\u0073\u0063\u0072\u006f\u006c\u006c\u0062\u0061\u0072\u002d\u0061\u0072\u0072\u006f\u0077\u002d\u0063\u006f\u000a\u007d\u000a\u002e\u0069\u0074\u0065\u006d\u0031\u0020\u007b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0034\u0037\u0025\u003b\u000a\u0009\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0038\u0032\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u003a\u0020\u0032\u0070\u0078\u003b\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0074\u006f\u0070\u003a\u0020\u0034\u0035\u0070\u0078\u003b\u0009\u000a\u0009\u006d\u0061\u0072\u0067\u0069\u006e\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u0033\u0035\u0070\u0078\u003b\u000a\u0009\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u0069\u006e\u006c\u0069\u006e\u0065\u002d\u0062\u006c\u006f\u0063\u006b\u003b\u000a\u007d\u000a\u002e\u0069\u0074\u0065\u006d\u0031\u0020\u002e\u0069\u0074\u0065\u006d\u002d\u006e\u006f\u006d\u0069\u006e\u0061\u006c\u0020\u007b\u000a\u0009\u0070\u0061\u0064\u0064\u0069\u006e\u0067\u002d\u0072\u0069\u0067\u0068\u0074\u003a\u0020\u0034\u0070\u0078\u003b\u000a\u0009\u0063\u006f\u006c\u006f\u0072\u003a\u0020\u0023\u0066\u0066\u0066\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0073\u0069\u007a\u0065\u003a\u0020\u0032\u0035\u0070\u0078\u003b\u000a\u0009\u0066\u006f\u006e\u0074\u002d\u0066\u0061\u006d\u0069\u006c\u0079\u003a\u0020\u0027\u006e\u0076\u006e\u0027\u002c\u0020\u0063\u0075\u0072\u0073\u0069\u0076\u0065\u003b\u000a\u0009\u0074\u0065\u0078\u0074\u002d\u0061\u006c\u0069\u0067\u006e\u003a\u0020\u0072\u0069\u0067\u0068\u0074\u003b\u000a\u0009\u0070\u006f\u0073\u0069\u0074\u0069\u006f\u006e\u003a\u0020\u0061\u0062\u0073\u006f\u006c\u0075\u0074\u0065\u003b\u000a\u0009\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u002d\u0036\u0039\u0070\u0078\u003b\u000a\u007d\u000a\u002e\u0069\u0074\u0065\u006d\u0031\u0020\u0069\u006d\u0067\u0020\u007b\u000a\u0009\u0077\u0069\u0064\u0074\u0068\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0020\u0020\u0020\u0020\u0068\u0065\u0069\u0067\u0068\u0074\u003a\u0020\u0031\u0030\u0030\u0025\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u003a\u0020\u0031\u0070\u0078\u0020\u0073\u006f\u006c\u0069\u0064\u0020\u0023\u0045\u0030\u0042\u0033\u0035\u0042\u003b\u000a\u0009\u0062\u006f\u0072\u0064\u0065\u0072\u002d\u0062\u006f\u0074\u0074\u006f\u006d\u003a\u0020\u0031\u0070\u0078\u0020\u0073\u006f\u006c\u0069\u0064\u0020\u0023\u0045\u0030\u0042\u0033\u0035\u0042\u003b\u000a\u007d\u000a\u002e\u0069\u0074\u0065\u006d\u0031\u0020\u0062\u0075\u0074\u0074\u006f\u006e\u0020\u007b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006e\u0064\u003a\u0075\u0072\u006c\u0028\u0069\u006d\u0067\u002f\u0062\u0074\u006e\u002d\u006f\u006e\u002e\u0070\u006e\u0067\u0029\u0020\u006e\u006f\u002d\u0072\u0065\u0070\u0065\u0061\u0074\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u0020\u0063\u0065\u006e\u0074\u0065\u0072\u003b\u000a\u0009\u0062\u0061\u0063\u006b\u0067\u0072\u006f\u0075\u006