079\u0072\u0069\u0067\u0068\u0074\u0020\u002d\u002d\u002d\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0066\u006f\u006f\u0074\u0065\u0072\u002d\u0074\u0078\u0074\u002d\u0063\u006f\u0070\u0079\u0072\u0069\u0067\u0068\u0074\u0022\u003e\u0050\u0072\u0069\u0076\u0061\u0063\u0079\u0020\u0050\u006f\u006c\u0069\u0063\u0079\u0020\u007c\u0020\u0047\u0061\u0072\u0065\u006e\u0061\u0020\u0047\u0061\u006d\u0065\u0073\u0020\u0055\u0073\u0065\u0072\u0020\u0041\u0067\u0072\u0065\u0065\u006d\u0065\u006e\u0074\u003c\u002f\u0064\u0069\u0076\u003e\u0020\u003c\u0021\u002d\u002d\u002d\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u002d\u0074\u0078\u0074\u002d\u0063\u006f\u0070\u0079\u0072\u0069\u0067\u0068\u0074\u0020\u002d\u002d\u002d\u003e\u000a\u003c\u0062\u0072\u003e\u000a\u003c\u002f\u0064\u0069\u0076\u003e\u0020\u003c\u0021\u002d\u002d\u002d\u0020\u0066\u006f\u006f\u0074\u0065\u0072\u0020\u002d\u002d\u002d\u003e\u000a\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u0020\u0069\u0074\u0065\u006d\u0052\u0065\u0077\u0061\u0072\u0064\u005f\u0063\u006f\u006e\u0066\u0069\u0072\u006d\u0061\u0074\u0069\u006f\u006e\u0020\u0061\u006e\u0069\u006d\u0061\u0074\u0065\u0064\u0020\u0066\u0061\u0064\u0065\u0049\u006e\u0022\u0020\u0073\u0074\u0079\u006c\u0065\u003d\u0022\u0064\u0069\u0073\u0070\u006c\u0061\u0079\u003a\u0020\u006e\u006f\u006e\u0065\u003b\u0022\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0077\u0072\u0061\u0070\u0070\u0065\u0072\u0022\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0062\u0067\u0032\u0022\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0073\u0065\u006c\u006f\u0077\u0032\u0022\u003e\u003c\u0062\u0072\u003e\u0042\u1ea1\u006e\u0020\u0063\u00f3\u0020\u0063\u0068\u1eaf\u0063\u0020\u0063\u0068\u1eaf\u006e\u0020\u006e\u0068\u1ead\u006e\u0020\u0070\u0068\u1ea7\u006e\u0020\u0071\u0075\u00e0\u0020\u006e\u00e0\u0079\u003f\u003c\u002f\u0064\u0069\u0076\u003e\u0020\u003c\u0021\u002d\u002d\u002d\u0020\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0061\u006c\u0065\u0072\u0074\u0020\u002d\u002d\u002d\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0069\u0074\u0065\u006d\u0020\u0069\u0074\u0065\u006d\u0053\u0068\u0069\u006e\u0065\u0022\u003e\u000a\u003c\u0064\u0069\u0076\u003e\u000a\u003c\u0066\u0069\u0067\u0075\u0072\u0065\u003e\u000a\u003c\u0069\u006d\u0067\u0020\u0073\u0072\u0063\u003d\u0022\u0022\u0020\u0069\u0064\u003d\u0022\u006d\u0079\u0049\u0074\u0065\u006d\u0052\u0065\u0077\u0061\u0072\u0064\u005f\u0063\u006f\u006e\u0066\u0069\u0072\u006d\u0061\u0074\u0069\u006f\u006e\u0049\u006d\u0067\u0022\u003e\u000a\u003c\u002f\u0066\u0069\u0067\u0075\u0072\u0065\u003e\u000a\u003c\u002f\u0064\u0069\u0076\u003e\u000a\u003c\u002f\u0064\u0069\u0076\u003e\u0020\u003c\u0021\u002d\u002d\u002d\u0020\u0070\u006f\u0070\u0075\u0070\u002d\u0062\u006f\u0078\u002d\u0069\u0074\u0065\u006d\u0020\u0069\u0074\u0065\u006d\u0053\u0068\u0069\u006e\u0065\u0020\u002d\u002d\u002d\u003e\u000a\u003c\u0062\u0072\u003e\u000a\u003c\u0064\u0069\u0076\u0020\u0063\u006c\u0061\u0073\u0073\u003d\u0022\u0070\u006f\u0070\u0075\u0070\u002d\u0066\u006f\u006f\u0074\u0065\u0072\u0022\u003e\u000a\u003c\u0069\u006e\u0070\u0075\u0074\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0068\u0069\u0064\u0064\u0065\u006e\u0022\u0020\u006e\u0061\u006d\u0065\u003d\u0022\u0065\u006d\u0061\u0069\u006c\u0022\u0020\u0076\u0061\u006c\u0075\u0065\u003d\u0022\u0022\u0020\u0072\u0065\u0061\u0064\u006f\u006e\u006c\u0079\u003e\u000a\u003c\u0062\u0075\u0074\u0074\u006f\u006e\u0020\u0074\u0079\u0070\u0065\u003d\u0022\u0062\